import React from 'react';

const App = () => {
  return (
    <>
      <form className="mern-ts">
        <input type='text' placeholder='Add Todo Item' />
        <button type='submit'>Add</button>
      </form>

      <ul className='todo-items'></ul>
    </>
  );
}

export default App;
